import React, { Component } from "react";
import styled from "@emotion/styled";

import { colors } from "./constants/styles";

import Input from './components/Input';

function App() {
  return (
    <Container>
      Hello
      <Input/>
    </Container>
  );
}

const Container = styled("div")`
    min-height: 100vh;
    width: 100%;
    background-color: ${colors.OFF_WHITE};
`;

export default App;
